local funcs = {}local nonfuncs = {}for k, v in pairs( ovel ) do  if type( k ) ~= "string" then osdie( "Non-sring key in ovel!" ) end  if( type( v ) == "function" ) then    funcs[ #funcs + 1 ] = k  else    nonfuncs[ #nonfuncs + 1 ] = k  endendtable.sort( funcs )print( #funcs .. " functions:\n\n" )for i = 1, #funcs do  print( funcs[ i ] .. "\n" )endtable.sort( nonfuncs )print( "\n\n\n" .. #nonfuncs .. " non-functions:\n\n" )for i = 1, #nonfuncs do  print( nonfuncs[ i ]  .. "\n" )end